import React, { Component } from 'react'
import Search from './Components/Search';
import Results from './Pages/Results/Results';
import newLocal from './Pages/newLocal/newLocal';
import Home from './Pages/Home/Home';
import Local from './Pages/Local/Local';
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import { geolocated } from "react-geolocated";
import axios from 'axios';
class App extends Component {
  constructor(props) {
    super (props);
  }
  async componentDidMount() {
    await this.getLocation();
  }
  async getLocation(){
    var loc = await this.props.coords ? [this.props.coords.latitude, this.props.coords.longitude] : [33.421942, -111.940021];

    axios.get(`https://maps.googleapis.com/maps/api/geocode/json?latlng=${loc[0]},${loc[1]}&key=AIzaSyC0gsrJf3UG_brzh_7F0YmHyZK7O2iZZvE`)
    .then((response)=>{console.log(response.data)})
    console.log(loc);
  }
  render(){
    return (
      <Router>
        <Search/>
        <Switch>
          <Route exact path={"/"} component={()=><Home/>}/>
          <Route path={"/search"} component={Results}/>
          <Route path={"/local"} component={Local}/>
          <Route path={"/create-local"} component={newLocal}/>
        </Switch>
      </Router>
    )
  }
}

export default geolocated({
  positionOptions: {
      enableHighAccuracy: false,
  },
  userDecisionTimeout: 5000,
})(App);
